import React, { useState } from 'react'
import { Card, Button, Form, Row, Col } from 'react-bootstrap'

const ShowMissingInformationPage = () => {
  const [editing, setEditing] = useState(false)
  const [responses, setResponses] = useState({
    name: '',
    age: '',
    gender: '',
    // Add more fields for other missing information
  })

  const handleEdit = () => {
    setEditing(true)
  }

  const handleDone = () => {
    setEditing(false)
    // Submit the responses back to the database
    console.log('Submitting responses:', responses)
  }

  const handleInputChange = (e, key) => {
    setResponses({
      ...responses,
      [key]: e.target.value,
    })
  }

  return (
    <div>
      <h1>Show Missing Information</h1>
      <Card style={{ width: '30rem', margin: '0 auto' }}>
        <Card.Body>
          <Card.Title>Missing Information</Card.Title>
          {editing ? (
            <Form>
              <Form.Group className='mb-3' controlId='formName'>
                <Form.Label>Name</Form.Label>
                <Form.Control
                  type='text'
                  placeholder='Enter name'
                  value={responses.name}
                  onChange={(e) => handleInputChange(e, 'name')}
                />
              </Form.Group>
              <Form.Group className='mb-3' controlId='formAge'>
                <Form.Label>Age</Form.Label>
                <Form.Control
                  type='text'
                  placeholder='Enter age'
                  value={responses.age}
                  onChange={(e) => handleInputChange(e, 'age')}
                />
              </Form.Group>
              <Form.Group className='mb-3' controlId='formGender'>
                <Form.Label>Gender</Form.Label>
                <Form.Control
                  type='text'
                  placeholder='Enter gender'
                  value={responses.gender}
                  onChange={(e) => handleInputChange(e, 'gender')}
                />
              </Form.Group>
              {/* Add more Form.Group elements for other missing information */}
            </Form>
          ) : (
            <Row>
              <Col xs={{ span: 6, offset: 3 }}>
                <Form.Check type='checkbox' label='Name' />
                <Form.Check type='checkbox' label='Age' />
                <Form.Check type='checkbox' label='Gender' />
                {/* Add more Form.Check elements for other missing information */}
              </Col>
            </Row>
          )}
          <Button
            variant='primary'
            style={{ marginTop: '10px', marginRight: '10px' }}
            onClick={handleEdit}
          >
            {editing ? 'Cancel' : 'Edit'}
          </Button>
          {editing && (
            <Button
              variant='success'
              style={{ marginTop: '10px' }}
              onClick={handleDone}
            >
              Done
            </Button>
          )}
        </Card.Body>
      </Card>
    </div>
  )
}

export default ShowMissingInformationPage
